import React, {Component} from 'react';
import Navigation from "./Navigation";

class Header extends Component {
    render() {
        return (
            <nav className={'navbar row justify-content-end row'}>
                <div className={"col-md-4 "}>
                    <Navigation/>
                </div>
            </nav>
        );

    }
}

export default Header;
